import axios from "axios";
import { message } from "antd";

const serviceUtil = {
  post: function post(url, payload, headers, callback) {
    const service = axios.create({});
    return new Promise((res, rej) => {
      try {
        service.post(url, payload, headers).then(() => res(callback()));
      } catch (error) {
        rej(error);
      }
    });
  },
  get: function get(url, headers, callback) {
    const service = axios.create({});
    return new Promise((res, rej) => {
      try {
        service.get(url, headers).then(() => res(callback()));
      } catch (error) {
        rej(error);
      }
    });
  },
};

export default serviceUtil;
